webpackJsonp([0xb1b5f87fe40],{3161:function(e,n){e.exports={pathContext:{docHtml:"<h1>shell-escape</h1>\n<p>Escape and stringify an array of arguments to be executed on the shell</p>\n<h2>Install</h2>\n<pre><code>npm install shell-escape\n</code></pre>\n<h2>Example</h2>\n<h3>simple</h3>\n<pre><code class=\"language-js\">var shellescape = require('shell-escape');\n\nvar args = ['curl', '-v', '-H', 'Location;', '-H', 'User-Agent: dave#10', 'http://www.daveeddy.com/?name=dave&#x26;age=24'];\n\nvar escaped = shellescape(args);\nconsole.log(escaped);\n</code></pre>\n<p>yields</p>\n<pre><code>curl -v -H 'Location;' -H 'User-Agent: dave#10' 'http://www.daveeddy.com/?name=dave&#x26;age=24'\n</code></pre>\n<p>A command suitable for being executed by the shell</p>\n<h3>advanced</h3>\n<pre><code class=\"language-js\">var shellescape = require('shell-escape');\n\nvar args = ['echo', 'hello!', 'how are you doing $USER', '\"double\"', \"'single'\"];\n\nvar escaped = shellescape(args);\nconsole.log(escaped);\n</code></pre>\n<p>yields</p>\n<pre><code>echo 'hello!' 'how are you doing $USER' '\"double\"' \\''single'\\'\n</code></pre>\n<p>and when run on the shell</p>\n<pre><code>$ echo 'hello!' 'how are you doing $USER' '\"double\"' \\''single'\\'\nhello! how are you doing $USER \"double\" 'single'\n</code></pre>\n<h2>License</h2>\n<p>MIT</p>",docPath:"argo-ci/node_modules/shell-escape/readme",proj:"argo-ci"}}}});
